content:
월즈 쓰리핏 파엠 원딜러가 티원에 나갔는데
다운그레이드 된 팀이 없다고 하노 시발;;
그러면서 페이즈는 신이라고 빨아주고 있네 진짜 응갤하냐??

티원이 바텀상성좋은픽 가져가게해주는거 국룰이고
케리아있는데
ㅋㅋ;;

대놓고 베트남 쌀국수련들 고용한거같음;;
댓글에 뭔 반응 1됴 없고 그냥 돈 받고 일하는거 마냥 주기적으로 똥 싸지르듯이 몰려와서 투척하고 사라지고 뭐하는 ㅅ끼들이냐
- dc official App

그 똥꼬쇼에 감탄한 젠지프론트가 김정수 바로 밴때려버리고 ㅇㅇ;;;
그래서 요즘 김정수 정수기 사업한다더라ㅋ
아님말구ㅋ
